// client/src/App.js
import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Routes, Route, Link, Navigate } from 'react-router-dom';
import { useTranslation } from 'react-i18next';
import axios from 'axios';

import Login from './components/Login';
import Register from './components/Register';
import Properties from './components/Properties';
import PropertyForm from './components/PropertyForm';
import HomePage from './components/HomePage'; // NEW ‚Äî public homepage

import './i18n';

axios.defaults.baseURL = 'http://localhost:3000';

const App = () => {
  const [user, setUser] = useState(null);
  const { t, i18n } = useTranslation();
  const languages = [
    { code: 'de', name: 'Deutsch' },
    { code: 'en', name: 'English' },
    { code: 'fr', name: 'Fran√ßais' },
    { code: 'es', name: 'Espa√±ol' },
    { code: 'tr', name: 'T√ºrk√ße' }
  ];

  useEffect(() => {
    const token = localStorage.getItem('token');
    if (token) {
      try {
        const payload = JSON.parse(atob(token.split('.')[1]));
        setUser(payload);
        axios.defaults.headers.common['Authorization'] = `Bearer ${token}`;
      } catch (e) {
        localStorage.removeItem('token');
      }
    }
  }, []);

  const handleLogout = () => {
    setUser(null);
    localStorage.removeItem('token');
    delete axios.defaults.headers.common['Authorization'];
  };

  const changeLanguage = (lng) => {
    i18n.changeLanguage(lng);
  };

  return (
    <Router>
      <div className="min-h-screen flex flex-col">
        {/* Header */}
        <header className="bg-primary text-white shadow-lg">
          <div className="container mx-auto px-4">
            <div className="flex justify-between items-center py-4">
              <div className="flex items-center">
                <Link to="/" className="text-2xl font-bold text-secondary">üè° Hausgold</Link>
              </div>

              <div className="hidden md:flex space-x-6">
                <Link to="/properties" className="hover:text-secondary transition-colors">{t('properties')}</Link>
                <Link to="/properties?type=buy" className="hover:text-secondary transition-colors">Kaufen</Link>
                <Link to="/properties?type=rent" className="hover:text-secondary transition-colors">Mieten</Link>
                {user && <Link to="/post" className="hover:text-secondary transition-colors">Verkaufen</Link>}
                <Link to="/about" className="hover:text-secondary transition-colors">√úber uns</Link>
              </div>

              <div className="flex items-center space-x-4">
                <select
                  onChange={(e) => changeLanguage(e.target.value)}
                  value={i18n.language}
                  className="bg-secondary text-white p-1 rounded text-sm"
                >
                  {languages.map((lang) => (
                    <option key={lang.code} value={lang.code}>
                      {lang.name}
                    </option>
                  ))}
                </select>

                {user ? (
                  <div className="flex items-center space-x-4">
                    <span className="text-sm">üëã {user.email}</span>
                    <button onClick={handleLogout} className="btn-secondary text-sm">
                      {t('logout')}
                    </button>
                  </div>
                ) : (
                  <div className="space-x-2">
                    <Link to="/login" className="hover:text-secondary transition-colors text-sm">
                      {t('login')}
                    </Link>
                    <Link to="/register" className="bg-secondary text-white px-4 py-2 rounded-lg hover:bg-opacity-90 transition-colors text-sm">
                      {t('register')}
                    </Link>
                  </div>
                )}
              </div>
            </div>
          </div>
        </header>

        {/* Main Content */}
        <main className="flex-grow">
          <Routes>
            <Route path="/" element={<HomePage />} />
            <Route path="/properties" element={<Properties />} />
            <Route path="/login" element={<Login setUser={setUser} />} />
            <Route path="/register" element={<Register />} />
            <Route path="/post" element={user ? <PropertyForm /> : <Navigate to="/login" />} />
            {/* Add more routes as needed: /about, /contact, /buy, /rent, /sell */}
            <Route path="*" element={<Navigate to="/" />} />
          </Routes>
        </main>

        {/* Footer */}
        <footer className="bg-primary text-white py-8">
          <div className="container mx-auto px-4">
            <div className="grid grid-cols-1 md:grid-cols-4 gap-8">
              <div>
                <h3 className="text-2xl font-bold text-secondary mb-4">HausGold</h3>
                <p className="text-w-400">Deutschlands vertrauensw√ºrdige Immobilienplattform</p>
              </div>

              <div>
                <h4 className="font-semibold mb-4">Entdecken</h4>
                <ul className="space-y-2">
                  <li><Link to="/properties?type=buy" className="text-w-400 hover:text-secondary transition-colors">Kaufen</Link></li>
                  <li><Link to="/properties?type=rent" className="text-w-400 hover:text-secondary transition-colors">Mieten</Link></li>
                  {user && <li><Link to="/post" className="text-w-400 hover:text-secondary transition-colors">Verkaufen</Link></li>}
                </ul>
              </div>

              <div>
                <h4 className="font-semibold mb-4">Unternehmen</h4>
                <ul className="space-y-2">
                  <li><Link to="/about" className="text-w-400 hover:text-secondary transition-colors">√úber uns</Link></li>
                  <li><Link to="/contact" className="text-w-400 hover:text-secondary transition-colors">Kontakt</Link></li>
                  <li><Link to="/privacy" className="text-w-400 hover:text-secondary transition-colors">Datenschutz</Link></li>
                </ul>
              </div>

              <div>
                <h4 className="font-semibold mb-4">Kontakt</h4>
                <div className="space-y-2 text-w-400">
                  <p>‚úâÔ∏è info@hausgold.de</p>
                  <p>‚òéÔ∏è +49 (0)40 635 5427</p>
                  <p>üìç Hamburg, Deutschland</p>
                </div>
              </div>
            </div>

            <div className="border-t border-w-800 mt-8 pt-8 text-center text-w-400">
              <p>&copy; 2025 Hausgold Ltd. | Jungfernstieg 24, 20354 Hamburg</p>
            </div>
          </div>
        </footer>
      </div>
    </Router>
  );
};

